import classes from './ProjectLink.module.css';

const ProjectLink = () => {
  return (
    <div className={classes.project1}>
      <a href="https://github.com/shashiiitp19/Freshworks-Engineering-Assignment" target="_blank">
        A Food Ordering App
      </a>
      <div className={classes.project2}>
        <a href="http://localhost:3000/">My Own Web App</a>
      </div>
    </div>
  );
};

export default ProjectLink;
